const Count = () => {
    const [product, setProduct] = useState(null)
    
    useEffect(() => {
        fetch(url)
            .then(res => {
                return res.json()
            })
            .then(data => {
                console.log(data)
                setProduct(data)
            })
    }, [url])

    return {product}
}
 
export default Count;
